import { 
  NEW_NOTE
} from '../actions/notes';

const initialState = {
  notes: [],
  openNote: {}
}

export function notes(state = initialState, action) {
  switch (action.type) {
    case NEW_NOTE:
      return [ ...state, action.note ];
    default: return state
  }
}
